        <>
            <div className="signupContainer">
                <div className="topBar">
                    <div className={`btn ${signupAs==="teacher"?"btn-warning":""}`}
                    onClick={()=>{
                        setSignupAs("teacher");
                    }}
                    >Signup As Teacher</div>
                    <div className={`btn ${signupAs==="teacher"?"btn-warning":""}`}
                    onClick={()=>{
                        setSignupAs("student");
                    }}
                    >Signup As Student</div>
                </div>
            </div>
        </>
    )
}

